import React from 'react';
import { Link } from 'react-router-dom';
import ChapterLink from './ChapterLink';

const MainMenu = () =>
{
    return (
        <div className="ui container">
            <h1>Main Menu</h1>
            <div className="ui center aligned three column centered grid">
                <div className="centered row">
                    <ChapterLink linkText="/faces" chapterName={"Faces"} chapterImg={"column"} image={""}/>
                    <Link to="/family" className="column">Family</Link>
                    <Link to="/moments" className="column">Moments</Link>
                </div>
                <div className="centered row">
                    <Link to="/music" className="column">Music</Link>
                    <Link to="/work" className="column">Work</Link>
                    <Link to="/travelling" className="column">Travelling</Link>
                </div>            
            </div>            
        </div>
    );
};

export default MainMenu;
